import React from 'react';
import { Link } from 'react-router-dom';

const App = () => {
  return (
    <div className="header-container">
      <h1>Home</h1>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/cart">Shopping Cart</Link>
        </li>
      </ul>
    </div>
  );
};

export default App;
